pragma solidity 0.8.19;

contract ChainMyVote {
    address private owner;
    uint private id;
    
    // Candidate
    Candidate[] private candidates;

    constructor() {
        owner = msg.sender;
    }

    modifier isOwner() {
        require(msg.sender == owner, "Sender is not owner.");
        _;
    }

    event CandidateAdded(Candidate candidate);

    function addCandidate(
        string memory title,
        string memory _address,
        string memory party,
        string memory logo
    ) isOwner public {
        uint candidateId = ++id;
        Candidate memory candidate = Candidate(candidateId, title, _address, party, logo);
        candidates.push(candidate);
        emit CandidateAdded(candidate);
    }

    function senderIsOwner() public view returns (bool) {
        return msg.sender == owner;
    }

    struct Candidate {
        uint id;
        string title;
        string _address;
        string party;
        string logo;
    }

    function getCandidates() isOwner public view returns (Candidate[] memory) {
        return candidates;
    }
}
